import companies from '../api';
import actions from '../actions';

const initialState = {
  companies,
  filters: []
}

const reducer = (state = initialState, action) => {
  switch (action.type) {

    case actions.Types.ADD_FILTER: {
      const newState = { ...state };
      return newState;
    }

    case actions.Types.REMOVE_FILTER: {
      const newState = { ...state };
      return newState;
    }

    default:
      return state;

  }
}

export default reducer;
